import React, { useState } from 'react';

const DataConsumerPanel: React.FC = () => {
  const [min, setMin] = useState<number | ''>('');
  const [max, setMax] = useState<number | ''>('');

  const handleSubmit = async () => {
    if (min === '' || max === '') {
        alert('enter both values')
        return
    }
    if (min >= max) {
        alert('max must be greater than min')
        return
    }
    try {
      const response = await fetch(
        'http://localhost:3001/data-request', 
        { 
            method: 'POST',
            headers: {
              'Content-Type': 'application/json'
            },
            body: JSON.stringify({ 
                user_id: 'dc123',
                data_type: 'blood_pressure',
                min, 
                max,
                leq: true,
                geq: true
            })
        }
      )
      const data = await response.json()
      const { id, exp_date } = data
      alert(`data request created\n id: ${id}\n, exp_date: ${exp_date}`)
      setMin('')
      setMax('')
      return
    } catch (err) {
      console.error(err)
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <h2>Data Consumer</h2>
      <h4>data type: blood_pressure</h4>
      <div style={{ marginTop: '20px' }}>
        <div style={{ margin: '10px' }}>
          <label>min: </label>
          <input
            type="number"
            value={min}
            onChange={(e) => setMin(Number(e.target.value))}
          />
        </div>
        <div style={{ margin: '10px' }}>
          <label>max: </label>
          <input
            type="number"
            value={max}
            onChange={(e) => setMax(Number(e.target.value))}
          />
        </div>
        <button
          onClick={handleSubmit}
          style={{
            marginTop: '20px',
            padding: '8px 16px',
            borderRadius: '6px',
            fontSize: '14px',
            backgroundColor: '#1976d2',
            color: 'white',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          Submit
        </button>
      </div>
    </div>
  );
};

export default DataConsumerPanel;
